import React, { Component } from "react";

export default class Product extends Component {
  constructor(props) {
    super(props);

    this.state = {
      content: ""
    };
  }

  render() {
    return (
      <div className="container">
        <header className="jumbotron">
        <div className="d-flex justify-content-center">
          <h3>Products</h3>
        </div>
        <br></br>
        <div className="d-flex justify-content-center">
        </div>
        </header>
      </div>
    );
  }
}
